import React from "react";
import "./Footer.css"
function Footer() {
    return (
       <footer>
    <div id="all_lists">
        <div class="flist">
            <ul>
                <li><a href="/about">About Website</a></li>{/*Aim-*/}
                <li><a href="/about">About Developers</a></li>
                <li><a href="/contact">Contact Us</a></li>{/*Customer Care-*/}
            </ul>
        </div>

        

        <div class="flist">
            <ul>
                <li><a href="#">Terms of Use</a></li>{/*-*/}
                <li><a href="#">Security</a></li>{/*-*/}
                <li><a href="#">Privacy</a></li>{/*-*/}
            </ul>
        </div>
        <hr/>
        <div class="flist add">

                ADDRESS:
                <p>Library Management Private Limited,<br/>Birla Institute of Technology<br/>Mesra, Ranchi-835215,<br/>Jharkhand, India</p>
        </div>
    </div>
    <div id="tc">
        <div>
            <i class="far fa-copyright"></i> 2022-2023 Copyright Library Management
        </div>

        <div id="footericons">
            <a href="" title="Facebook"><i class="fab fa-facebook-square"></i></a>&nbsp;
            <a href="" title="Instagram"><i class="fab fa-instagram"></i></a>&nbsp;
            <a href="#" title="Mail"><i class="fas fa-envelope"></i></a>&nbsp;
            <a href="#" title="Youtube"><i class="fab fa-youtube"></i></a>&nbsp;
            <a href="#" title="Twitter"><i class="fab fa-twitter"></i></a>&nbsp;
            <a href="#" title="LinkedIn"><i class="fab fa-linkedin"></i></a>&nbsp;
        </div>
    </div>
</footer>
    );
}

export default Footer;
